import Head from 'next/head'
import Navbar from '../components/navbar'
const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>Brad Travarsary</title>
      </Head>
      <Navbar />
      {props.children}
    </div>
  )
}
export default Layout
